var title_f13_61_14299="Major causes of right axis deviation";
var content_f13_61_14299=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71386&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71386&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major causes of right axis deviation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Artifactual",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Left-right arm electrode reversal (look for negative P and negative QRS in lead I)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal variant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Right ventricular overload",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Acute - pulmonary embolus or other causes of acute cor pulmonale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Chronic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Chronic obstructive lung disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Any cause of right ventricular hypertrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lateral wall myocardial infarction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dextrocardia, as with situs inversus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Left posterior fascicular block - must exclude other causes listed above",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
