var title_f13_61_14300="Phases of tonic clonic seizures";
var content_f13_61_14300=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F54942&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F54942&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Phases of tonic-clonic seizures",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Aura (None)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Tonic phase (10 to 20 seconds)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sudden loss of consciousness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Loss of posture with high risk of self injury depending on activity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Brief flexion of arms, eyes deviated upward",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Extension of back, neck, arms, and legs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Involuntary crying out from contraction of respiratory muscles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shallow respiration, cyanosis may occur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ends with tremors which gradually slow and merge with clonic phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Clonic phase (30 to 90 seconds)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Brief, violent, generalized flexor contractions alternating with progressively longer muscle relaxation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cyanosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible cheek or tongue biting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Foamy salivation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible loss of bowel or bladder control",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ends with deep inspiration, sustained muscle relaxation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Postictal phase (Minutes to several hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Headache, mild confusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Muscles sore",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fatigue, patient may sleep and awake refreshed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Other features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fast heart rate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Respiratory and metabolic acidosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dilated pupils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Risk of vertebral fracture, pneumonia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
