var title_f13_61_14301="Reversible cause incontinence A";
var content_f13_61_14301=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F82618%7EPC%2F60839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F82618%7EPC%2F60839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Identification of reversible conditions that cause or contribute to urinary incontinence",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Condition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Affecting the lower urinary tract",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urinary tract infection (symptomatic with frequency, urgency, dysuria, etc)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Atrophic vaginitis/urethritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pregnancy/vaginal delivery/ episiotomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Postprostatectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stool impaction",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\">",
"        Increased urine production",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Metabolic (hyperglycemia, hypercalcemia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Excess fluid intake",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Volume overload:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Venous insufficiency with edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Heart failure",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\">",
"        Impaired ability or willingness to reach a toilet",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Delirium",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic illness, injury or restraint that interferes with mobility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Psychological",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\">",
"        Nocturia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nocturnal polyuria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sleep disturbance",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Identification and management of reversible conditions that cause or contribute to urinary incontinence: part B",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Condition",
"      </td>",
"      <td class=\"subtitle1\">",
"       Management",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"       Increased urine production",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Metabolic (hyperglycemia, hypercalcemia)",
"      </td>",
"      <td>",
"       Improved control of diabetes mellitus or treatment of hypercalcemia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Excess fluid intake",
"      </td>",
"      <td>",
"       Reduction in intake of excess fluids, especially diuretic fluids (eg, caffeinated beverages, including soda, alcohol)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2_start\" colspan=\"2\" rowspan=\"1\">",
"       Volume overload:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Venous insufficiency with edema",
"      </td>",
"      <td class=\"sublist_other\">",
"       Support stockings; leg elevation; sodium restriction; diuretic therapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Heart failure",
"      </td>",
"      <td class=\"sublist_other\">",
"       Medical therapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"       Impaired ability or willingness to reach a toilet",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Delirium",
"      </td>",
"      <td>",
"       Diagnosis and treatment of underlying causes of acute confusional state",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Chronic illness, injury or restraint that interferes with mobility",
"      </td>",
"      <td>",
"       Address cause of impaired mobility, remove restrains if possible. Regular toileting; use of toilet substitutes and environmental alterations (eg, bedside commode, urinal)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Psychological",
"      </td>",
"      <td>",
"       Appropriate pharmacologic and/or nonpharmacologic treatment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Nocturia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Nocturnal polyuria",
"      </td>",
"      <td>",
"       Assess evening fluid intake, assess for volume overload, consider sleep apnea if other symptoms, signs, or risk factors present",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Sleep disturbance",
"      </td>",
"      <td>",
"       Sleep hygiene; assess for pain, depression, and environmental causes; consider sleep apnea if other symptoms, signs, or risk factors present",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
